import React, { useEffect, useState } from 'react';
import './App.css';

interface WeatherInformation {
  summary: string;
  temperatureC: number;
}

function App() {
  const [weatherData, setWeatherData] = useState<WeatherInformation[]>([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("https://localhost:7175/api/weatherforecast");
      const weatherResults = await response.json();
      setWeatherData(weatherResults);
    }
    getData();
  }, [])

  return (
    <>
      <h1>{weatherData.length}</h1>
      <ul>
      {weatherData.map(w => {
        <div>
          <li>{w.summary}</li>
          <li>{w.temperatureC}</li>
          </div>
      })}
      </ul>
    </>
  );
}

export default App;
